import React, {useState, useEffect} from 'react'
import styled from 'styled-components';
import Header from './Header';

var displayData;

function Players() {

    fetch("http://localhost:8080/api/data.json")
    .then(response => response.text())
    .then(data => {
      const getIMG = ({players}) => {
        return (
          <img src={require(`./logos/${players.team}.gif`)} alt={players.team}/>
        )
      };

      console.log(data.json());


      displayData = data.map((players) => {

        if(players.team === "N/A") {
          return;
        };

        return(
          <tr>
            <td className='logo'>{getIMG({players})}</td>
            <td>{players.position}</td>
            <td>{players.name}</td>
            <td>{players.points}</td>
            <td>{players.pass_cmp}</td>
            <td>{players.pass_att}</td>
            <td>{players.pass_yds}</td>
            <td>{players.pass_td}</td>
            <td>{players.pass_int}</td>
            <td>{players.pass_sacked}</td>
            <td>{players.pass_sacked_yds}</td>
            <td>{players.pass_rating}</td>
            <td>{players.rush_att}</td>
            <td>{players.rush_yds}</td>
            <td>{players.rush_td}</td>
            <td>{players.targets}</td>
            <td>{players.rec}</td>
            <td>{players.rec_yds}</td>
            <td>{players.rec_td}</td>
            <td>{players.fumbles_lost}</td>
            <td>{players.rush_scrambles}</td>
            <td>{players.designed_rush_att}</td>
            <td>{players.two_point_conv}</td>
            <td>{players.total_ret_td}</td>
            <td>{players.offensive_fumble_recovery_td}</td>
            <td>{players.pass_yds_bonus}</td>
            <td>{players.rush_yds_bonus}</td>
            <td>{players.rec_yds_bonus}</td>
            <td>{players.pass_target_yds}</td>
            <td>{players.pass_poor_throws}</td>
            <td>{players.pass_hurried}</td>
            <td>{players.rush_yds_before_contact}</td>
            <td>{players.rush_yac}</td>
            <td>{players.pass_blitzed}</td>
            <td>{players.rush_broken_tackles}</td>
            <td>{players.rec_air_yds}</td>
            <td>{players.rec_yac}</td>
            <td>{players.rec_drops}</td>
            <td>{players.offense}</td>
            <td>{players.off_pct}</td>
            <td>...</td>
          </tr>
        )
      }
      )
    });

    return (
      <>
      <Header/>

      <PlayerContainer>
        <div>
          <table>
            <thead>
              <tr>
                <th>Team</th>
                <th>Position</th>
                <th>Name</th>
                <th>2021 Points</th>
                <th>pass_cmp</th>
                <th>pass_att</th>
                <th>pass_yds</th>
                <th>pass_td</th>
                <th>pass_int</th>
                <th>pass_sacked</th>
                <th>pass_sacked_yds</th>
                <th>pass_rating</th>
                <th>rush_att</th>
                <th>rush_yds</th>
                <th>rush_td</th>
                <th>targets</th>
                <th>rec</th>
                <th>rec_yds</th>
                <th>rec_td</th>
                <th>fumbles_lost</th>
                <th>rush_scrambles</th>
                <th>designed_rush_att</th>
                <th>two_point_conv</th>
                <th>total_ret_td</th>
                <th>offensive_fumble_recovery_td</th>
                <th>pass_yds_bonus</th>
                <th>rush_yds_bonus</th>
                <th>rec_yds_bonus</th>
